const MapaEmpleo = (url,container,etiq,varPor,titulo,subtitulo) => {
    const mapa = getData(url,etiq,varPor)
    let arr_map = (res) => {
        let d=[]
        for(let i=0;i<res.datos.length;i++){
            let dt = res.datos[i].data[res.datos[0].data.length-1]
            d.push(dt)
            }
        return d
    }
    mapa.then( 
        res => mp(arr_map(res),container,titulo,subtitulo)
        
    ).catch( error => console.log(error))
}


